import { style_mapping } from "../styled";

const {
    shared: { WidgetContainer }
} = style_mapping;

class Widget extends Component {
  render() {
    return (
      <WidgetContainer>

        <h2>{props.title1}</h2>
        <ul>
          <li>Lorem Ipsum</li>
          <li>Lorem Ipsum</li>
          <li>Lorem Ipsum</li>
        </ul>
      </WidgetContainer>
    )
  }
}

export default Widget
